	private WeightedDigraph parse(String debugOutput){
		List<Edge> edges = new LinkedList<Edge>();
		int maxVid = 0;
		String[] formatted = debugOutput.replace("[", "").replace("]", "").replace("-", "").replace(">", "").replace("(", " ").replace(")", " ").split(",");
		for(String s : formatted){
			String[] nums = s.trim().split(" ");
			int left = Integer.parseInt(nums[0]);
			int right = Integer.parseInt(nums[2]);
			int weight = Integer.parseInt(nums[1]);
			
			if(right > maxVid ){
				maxVid = right;
			}
			
			if(left > maxVid){
				maxVid = left;
			}
			
			edges.add(new Edge(left, right, weight));
		}
		WeightedDigraph g = new WeightedDigraph(maxVid+1);
		for(Edge e : edges){
			g.addEdge(e);
		}
		return g;
	}
	
	@Test
	public void test() {
		init();
		int count = 0;
		for(String testCase : testCases){
			System.out.printf("\nTEST CASE %s\n\n", count++);
			WeightedDigraph g = parse(testCase);
			MinMatchingAlg mma = new MinMatchingAlg(g);
			mma.run();
		}
	}
	
